import React,{Fragment} from 'react';
import { Profesional } from './profesional';
export const Especialidades = ({especialidades}) => {
    return (
        <div className="container">

            {especialidades.map((especialidad,index) => {
                return (<div className="row">
                            <div className="col-12" key={especialidad.id}>
                                <h2>{especialidad.titulo}</h2>
                            </div>
                            {especialidad.profesionales.map((profesional,index) => {
                                return (<div className="col-12 col-md-3" key={profesional.id}>
                                            <Profesional profesional={profesional}/>
                                        </div>)
                            })}
                        </div>)
            })
        }
        </div>
    );
};
